import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  padding: 20px;
  text-align: center;
`;

const Button = styled.button`
  padding: 10px 20px;
  margin-top: 20px;
  background-color: #007bff;
  color: white;
  border: none;
  border-radius: 5px;
  cursor: pointer;
  &:hover {
    background-color: #0056b3;
  }
`;

const HomePage: React.FC = () => {
  return (
    <Container>
      <h1>퀘스티오에 오신 것을 환영합니다</h1>
      <p>포트폴리오 기반의 인터뷰 준비 도구로 잠재력을 극대화하세요</p>
      <Button>시작해보기</Button>
    </Container>
  );
};

export default HomePage;
